Begginers struggle 👇 Please Read👇
I have watched hundreds of videos to make the perfect one and wanted to look preety good on camera but here's how i shot this video and TBH its so me. 
Not being perfect and that's how i make my faces or expressions whenever i do my makeup.
As a begginer you dont need to hide every pimple or marks like a pro just do the way as you like and enjoy makeup ...You dont need to follow every steps.
If you're a begginer 
And learning anything that you love doing today for me you're Perfect 👌
You just dont need to give up and keep learning ❤️
Comment down below👇
You're thought as a makeup begginer ❤️
